import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Добро пожаловать в React</h1>
        <p>
          Начните редактировать файл <code>src/App.js</code> чтобы изменить эту страницу.
        </p>
      </header>
    </div>
  );
}

export default App;
